export interface Snapshot {
    application_uid: string;
    version: string;
    snapshot_id: string;
    domain: string;
    uid: {
        build: string;
        app_name: string;
        repo: string;
        org: string;
    };
    git: {
        name?: string;
        email?: string;
        branch: string;
        commit: string;
        tags?: string[];
    };
    creator: {
        name: string;
        email: string;
    };
    createdAt: number;
    mfConfig?: {
        name: string;
        filename: string;
        exposes?: Record<string, string>;
        remotes?: Record<string, string>;
        shared?: Record<string, unknown>;
    };
    assets: Record<string, SnapshotAsset>;
}
export interface SnapshotAsset {
    path: string;
    extname: string;
    hash: string;
    size: number;
}
export interface SnapshotMetadata {
    pages_url?: string;
}
